import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header.jsx';
import HeadmasterDashboard from './components/Dashboard/HeadmasterDashboard';
import TeacherDashboard from './components/Dashboard/TeacherDashboard';
import StudentDetails from './Pages/StudentDetail';
import Login from './Pages/Login';

const App = () => (
  <Router>
    <Header />
    <div className="container mx-auto p-4">
      <Routes>
        <Route path="/" element={<Login />} /> {/* Default route for login */}
        <Route path="/headmaster" element={<HeadmasterDashboard />} />
        <Route path="/teacher" element={<TeacherDashboard />} />
        <Route path="/student/:id" element={<StudentDetails />} />
      </Routes>
    </div>
  </Router>
);

export default App;
